('1943','2','2118','Wohnung Elena',Null,'Sehr gepflegtes 2-3 Schlafzimmer-Apartment in Nova Santa Ponsa','24597','Nur wenige Gehminuten vom durch den Stardesigner Philippe Starck neu gestalteten Jachthafen Port Adriano entfernt, befindet sich diese schicke 2-3 Schlafzimmerwohnung. Drei Golfplätze liegen nur wenige Fahrminuten entfernt. Die sehr beliebte Wohnanlage wurde vor ca. 10 Jahren erstellt und befindet sich in einem einwandfreien Zustand. Das Apartment liegt im 2. Obergeschoss, das man bequem mit dem Fahrstuhl erreichen kann. Die ca. 120 m² Wohnfläche verteilt sich auf 2 Schlafzimmer mit 2 Bädern, ein Büroraum (drittes Schlafzimmer), Wohn-Esszimmer und Küche. Von der südlich ausgerichteten, ca. 15 m² großen Terrasse, hat man einen sehr schönen Blick über den parkähnlich angelegten Garten mit Gemeinschaftspool.\r\nEine Klimaanlage sorgt Sommer wie Winter für ein angenehmes Raumklima. Die Wohnung wird möbliert vermietet.','24598','1200','111','2013-01-28 15:02:19','106','2013-01-28 15:02:39',Null,'1690','121','814',1,'1','0',Null,Null,'auf Anfrage','24599',Null,'0','0','0',Null,'2015-09-30 10:39:02',1,'0',Null,Null,Null,Null,'5',1,1,1,'0','1','1',1,1,Null,'24600',Null,'24601',Null,'24602',Null,'24603','Max Friedrich 654.983.109','24604','0',0,'0');
